import React from "react";
import "./Residencies.css";
import { useContext } from "react";
import { Context } from "../../context/context";
import Link from "antd/es/typography/Link";
import PropertyCard from "../PropertyCard/PropertyCard";

const Residencies = () => {
  const { listProducts } = useContext(Context);
  console.log(listProducts);
  // const SlideNextButton = () => {
  //   const swiper = useSwiper();
  //   return (
  //     <div className="flexCenter r-buttons">
  //       <button onClick={() => swiper.slidePrev()} className="r-prevButton">
  //         &lt;
  //       </button>
  //       <button onClick={() => swiper.slideNext()} className="r-nextButton">
  //         &gt;
  //       </button>
  //     </div>
  //   );
  // };
  return (
    <div className="bg-red-200  py-4">
      <div className="r-container gap-4  ">
        {/* cake  */}
        <div className="flex gap-y-8 justify-center items-center flex-wrap">
          <img src="https://theme.hstatic.net/200000411281/1000949882/14/icon-title-home-featured-product.png?v=240" />
        </div>

        <span className=" text-[#ffa500] text-3xl font-semibold">
          Sản phẩm nổi bật
        </span>
        <p className="text-[#8c8b8b] text-[1.5rem]">
          Cập nhật về những sản phẩm nổi bật nhất từ Fresh Garden
        </p>
        <div className=" flex ">
          {/* <PropertyCard /> */}
          <Link href={<PropertyCard />}>
            {listProducts?.map((card) => {
              return (
                <div>
                  <img src={card.image} />
                  <div>{card.name}</div>
                  <div>{card.price}</div>
                </div>
              );
            })}
          </Link>
        </div>
        {/* sinh nhat cake  */}
      </div>
    </div>
  );
};

export default Residencies;
